import { Injectable } from '@angular/core';
import { Tile } from '../components/game-board/game-board.component';

@Injectable({
  providedIn: 'root',
})
export class TilesService {
  constructor() {}

  generateTiles(size: 6 | 9) {
    let TILES: Tile[] = [];
    for (let i = 0; i < size; i++) {
      TILES.push({
        text: Math.round(Math.random() * 100).toString(),
        clicked: false,
      });
    }

    return TILES;
  }
}
